import React from "react";
import { Drawer } from "@material-ui/core";

const paperstyle = {
  height: "85%",
  width: "85%",
  margin: "7%",
  textAlign: "center",
  display: "inline-block",
};

function SideBar() {
  return (
    <div>
      <Drawer docked={false} width={200}>
        {" "}
        open={true}{" "}
      </Drawer>
    </div>
  );
}

export default SideBar;
